const pokemonsListReducer = (state, action) => {
  switch (action.type) {
    case "LOWER_OFFSET": {
      return console.log("4", action.state.limit);
    }

    case "RAISE_OFFSET": {
      return console.log("8", action.state.limit);
    }

    case "LIMIT": {
      return console.log("12", action.state.limit);
    }

    default:
      return state;
  }
};

export default pokemonsListReducer;
